var tipuesearch = {"pages": [{'title': 'About', 'text': '本網站倉儲:  https://github.com/s40723136/cad2019 \n 本網站網址: https://s40723136.github.io/cad2019 \n', 'tags': '', 'url': 'About.html'}, {'title': '組別倉儲網站', 'text': '分組網站: https://s40723148.github.io/cad2019ag1 \n 分組倉儲: https://github.com/s40723148/cad2019ag1 \n', 'tags': '', 'url': '組別倉儲網站.html'}, {'title': '倉儲網站的使用說明', 'text': '此內容管理系統以\xa0 https://github.com/mdecourse/cmsimde \xa0作為 submodule 運作, 可以選定對應的版本運作, cmsimde 可以持續改版, 不會影響之前設為 submodule, 使用舊版 cmsimde 模組的內容管理相關運作. \n 利用 cmsimde 建立靜態網誌方法: \n 1. 在 github 建立倉儲, git clone 到近端 \n 2. 參考\xa0 https://github.com/mdecourse/newcms , 加入除了 cmsimde 目錄外的所有內容 \n 以 git submodule add\xa0 https://github.com/mdecourse/cmsimde \xa0cmsimde \n 建立 cmsimde 目錄, 並從 github 取下子模組內容. \n 3.在近端維護時, 更換目錄到倉儲中的 cmsimde, 以 python wsgi.py 啟動近端網際伺服器. \n 動態內容編輯完成後, 以 generate_pages 轉為靜態內容, 以 git add commit 及 push 將內容推到遠端. \n 4. 之後若要以 git clone 取下包含 submodule 的所有內容, 執行: \n git clone --recurse-submodules  https://github.com/mdecourse/newcms.git \n Develop \n https://github.com/mdecourse/cmsimde \xa0的開發, 可以在一個目錄中放入 cmsimde, 然後將 up_dir 中的內容放到與 cmsimde 目錄同位階的地方, 使用 command 進入 cmsimde 目錄, 執行 python wsgi.py, 就可以啟動, 以瀏覽器 https://localhost:9443\xa0就可以連接, 以 admin 作為管理者密碼, 就可以登入維護內容. \n cmsimde 的開發採用 Leo Editor, 開啟 cmsimde 目錄中的 cmsimde.leo 就可以進行程式修改, 結束後, 若要保留網際內容, 只要將 cmsimde 外部的內容倒回 up_dir 目錄中即可後續對 cmsimde 遠端倉儲進行改版. \n init.py 位於\xa0 up_dir 目錄, 可以設定 site_title 與 uwsgi 等變數. \n', 'tags': '', 'url': '倉儲網站的使用說明.html'}, {'title': '這段時間做了些什麼', 'text': '', 'tags': '', 'url': '這段時間做了些什麼.html'}, {'title': 'NX', 'text': '繪製小型車給後續WEBOTS與V-REp模擬使用 \n', 'tags': '', 'url': 'NX.html'}, {'title': 'WEBOT', 'text': '根據WEBOTS網站教程進行操作 \n 網站教程 https://cyberbotics.com/doc/guide/tutorial-1-your-first-simulation-in-webots \n 參考老師網頁上轉檔方式將NX繪製小型車進行檔案轉檔並模擬(沒成功) \n WEBOTS轉檔教學 http://mde.tw/cad2019/content/Webots.html \n', 'tags': '', 'url': 'WEBOT.html'}, {'title': 'VREP', 'text': '以老師提供教學檔案學習如何使用 \n 教程 http://mde.tw/cad2019/content/V-rep%20Manual.html \n VREP官網資料 http://www.coppeliarobotics.com/features \n', 'tags': '', 'url': 'VREP.html'}, {'title': 'ssh設定', 'text': '參考網站 https://www.youtube.com/watch?v=yVgyAHBIyOQ \n', 'tags': '', 'url': 'ssh設定.html'}, {'title': '學期測試', 'text': '', 'tags': '', 'url': '學期測試.html'}, {'title': 'W15', 'text': 'W15 2a 查驗 \n 請 2a 每位學員在 12:00 之前, 錄製一個至多 3 分鐘帶說明字幕的影片, 說明至今與本課程相關, 所完成的重要內容, 完成後將影片上傳至個人 Youtube 帳號下, 嵌入個人 W15 網頁後, 將倉儲提交連結與影片連結放入下列回應區, 並在回應區寫上個人詳細學習心得. \n https://github.com/mdecourse/cad2019/issues/31 \n 說明 \n 倉儲連結: https://github.com/s40723136/cad2019ag1 影片:無 心得:倉儲僅有follow同組通學的推送，影片也拿不出東西，對於webots的學習進度也異常緩慢v rep學習尚未深入，nx繪製零件雖看著教程還是不會導入webots與v rep無法做到結合，整體來說學習成效不佳還需努力 \n', 'tags': '', 'url': 'W15.html'}, {'title': 'W16', 'text': 'W16 2a cad 練習 \n 請注意: 只有在 12/27 (五) 09:30-12:00 製作的影片與倉儲所提交的內容納入計分 \n 請 2a 各學員根據 \xa0 Task2 \xa0 中 \xa0 Onshpae 越野車零組件 之尺寸與配置, 利用 Solvespace 完成簡化後的越野車零組件設計繪圖. \n 完成後請將所有零組件檔案, 放入個人倉儲 downloads 目錄中的 solvespace 子目錄, 然後將越野車組立件, 以 STL 格式轉出後, 轉入 V-rep 後, 將 ttt 檔案放入個人倉儲 downloads 目錄中的 solvespace 子目錄. \n 並將越野車組立件, 以 WRL 格式轉出後, 轉入 Webots 後, 將 wbt 檔案放入個人倉儲 downloads 目錄中的 solvespace 子目錄. \n 完成上述查驗任務後, 請將簡要過程拍成至多 3 分鐘的帶說明字幕導覽影片, 並將影片嵌入 W16 查驗頁面後, 將提交連結, 頁面連結與影片連結放入下列回應中, 附上操作心得, 並針對所碰到的問題進行說明討論. \n https://github.com/mdecourse/cad2019/issues/34 \n 說明 \n 40723136 倉儲: https://github.com/s40723136/cad2019 心得:這周也沒辦法拿出影片，但能在倉儲上交出零件，也算是一種進步吧.... \n', 'tags': '', 'url': 'W16.html'}, {'title': 'W17', 'text': '題目一: (各分組協同製作題) \n 請各組組長將 \xa0 http://www.coppeliarobotics.com/helpFiles/en/buildingAModelTutorial.htm \xa0 與 \xa0 https://cyberbotics.com/doc/guide/tutorial-2-modification-of-the-environment \xa0 等兩份教學內容, 平均分配給各組員, 經由翻譯了解操作過程後, 在各分組網站中, 以 "W17 協同任務" 作為頁面標題, 登錄各組員的分配表, 採用中英文並列的方式呈現兩份教學內容. \n 題目二: (各組員獨立製作題) \n 請參考下列影片中的機構設計, 從 \xa0 https://github.com/mdecourse/cad2019/tree/master/downloads/solvespace/curiosity/ \xa0 擷取草圖設計概念, 利用 Solvespace 或 NX12 將原本車身與主連桿所採用的馬達鎖定設計, 改為機械阻尼(彈簧與極限定位)設計, 完成各零件的尺寸標示工程圖與 Engineering Bill of Material 後轉入 V-rep, 將所有 .slvs (或 .prt) 與 .ttt 檔案放入個人倉儲 downloads 目錄中的 w17/curiosity 目錄後, 將操作過程紀錄於個人網站中的 "W17 個人任務" 頁面中, 並嵌入一個至多 2 分鐘, 帶字幕的影片, 介紹說明操作過程與所完成的結果. \n \n 完成上述兩題後, 請各組員將相關連結(包括題目一的個人貢獻連結與題目二的倉儲連結、網頁連結與影片連結), 放入下列回應中, 並針對所碰到的問題進行說明討論. \n https://github.com/mdecourse/cad2019/issues/37 \n 說明 \n 這週對於車的進度依舊緩慢， 任務一的內容可以觀看倉儲或是小組倉儲， 任務二沒有動靜，可能要再另外再花時間製作。 倉儲: https://github.com/s40723136/cad2019 小組倉儲: https://github.com/s40723148/cad2019ag1 影片: https://www.youtube.com/channel/UCCkkl-lhe1eX8mlYYH-S1Rw \n', 'tags': '', 'url': 'W17.html'}, {'title': 'W18', 'text': '期末自評流程 \n 流程一: \n 利用網際試算表單取各學員的學期自評成績. \n 流程二: \n 每位學員在至多 2 分鐘的時間內, 利用廣播教學系統, 以個人網站上的 Reveal.js 進行簡報, 說明個人在本課程所完成的任務內容, 並說明如何計分得到個人的學期自評成績. (請注意: 簡報過程中不可使用 USB 隨身碟、近端電腦中的檔案 或 Powerpoint, 只能使用瀏覽器中個人的 Reveal.js 簡報系統, 且在不登入 Github 個人帳號情況下進行簡報, 例如:透過 \xa0 http://mde.tw/cad2019/reveal/ \xa0 進行簡報). \n 說明 \n https://s40723136.github.io/cad2019/reveal/', 'tags': '', 'url': 'W18.html'}]};